import "./loading.scss";
export function Loading() {
  return (
    <div className='loading' id="loading">
      <div className='gerb' id='gerb'>< img src="../../../../government/zin.png" /></div>
      <div className='txt' id='txt'>Հայաստանի Հանրապետության<br /> Կառավարություն</div>
    </div>
  )
}
